tc = int(input())for c in range(tc):    r = [[]]*2    r[0] = [0]*4    r[1] = [0]*4    for i in range(2):        at = int(input())        for j in range(4):            li = list(map(int,input().split()))            if j == at-1:                r[i] = li#print(r[0], r[1])    common = 0    num = 1    for t in r[0]:        if t in r[1]:            num = t            common = common + 1    print('Case #', end="")    print(c+1,end="")    print(": ", end="")    if common > 1:        print("Bad magician!")    elif common ==  1:        print(num)    elif common == 0:        print("Volunteer cheated!")